arts by placing new orders via our website, via email or over the phone. \nOnce orders are completed, we have developed a few options to get these orders in our clients\u2019 hands. We have integrated a \u201ccurbside pickup\u201d model for those that still want to pick up their order in person. Simply call ahead and we can meet you outside with your order without the need to get out of the car. \nWe are also offering to cover the first $35 towards the shipping cost on any completed invoice. We understand that it is safer to stay home and want to help do our part to facilitate that.\n\u2022\n\u2022\n\u2022\n#dtla #dtlaartsdistrict #screenprinters #screenprintingshop #smallbusiness #smallbusinessowner #covid_19 #coronavirus"}}]},"edge_media_to_comment":{"count":3},"comments_disabled":false,"taken_at_timestamp":1585081616,"edge_liked_by":{"count":32},"edge_media_preview_like":{"count":32},"location":{"id":"323911671","has_public_page":true,"name":"Print Renegades","slug":"print-renegades"},"thumbnail_src":"https:\/\/instagram.fozh1-1.fna.fbcdn.net\/v\/t51.2885-15\/sh0.08\/e35\/c0.140.1440.1440a\/s640x640\/90636628_204347340873124_4889657614500558000_n.jpg?_nc_ht=instagram.fozh1-1.fna.fbcdn.net&_nc_cat=104&_nc_ohc=3nV5muaTCHcAX-l3aRY&oh=845a215546637a351b6ab2421367c9ba&oe=5F1C83BE","thumbnail_resources":[{"src":"https:\/\/instagram.fozh1-1.fna.fbcdn.net\/v\/t51.2885-15\/e35\/c0.140.1440.1440a\/s150x150\/90636628_204347340873124_4889657614500558000_n.jpg?_nc_ht=instagram.fozh1-1.fna.fbcdn.net&_nc_cat=104&_nc_ohc=3nV5muaTCHcAX-l3aRY&oh=490f9371aee1fe7a47b6b22f6d85117c&oe=5F1B89F7","config_width":150,"config_height":150},{"src":"https:\/\/instagram.fozh1-1.fna.fbcdn.net\/v\/t51.2885-15\/e35\/c0.140.1440.1440a\/s240x240\/90636628_204347340873124_4889657614500558000_n.jpg?_nc_ht=instagram.fozh1-1.fna.fbcdn.net&_nc_cat=104&_nc_ohc=3nV5muaTCHcAX-l3aRY&oh=2c17841699af115269acb46ddd1b607b&oe=5F1A813D","config_width":240,"config_height":240},{"src":"https:\/\/instagram.fozh1-1.f